package basic;

public class Text69 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,j;
		System.out.println("multiplication table 1-10:");
		for(i=1;i<=10;i++)
		{
			for(j=1;j<=10;j++)
			{
				System.out.print(i*j);
				System.out.print("\t");
			}
			System.out.println("");
			
		}
	}

}
